     function INFShow(id)
{
for (var i = 0;i < 3;i++)
{
var INFV = document.getElementById("INFV" + i);
var INFC = document.getElementById("INFC" + i);
if (i == id)
{
INFV.className = 'I_over';
INFC.style.display = "";
}
else
{
INFV.className = 'I_overo';
INFC.style.display = "none";
}
}
}

